import React from 'react';

const Card = (prop) => {
	return (	
		<div className='tc bg-light-green dib br3 pa3 na0 grow bx2 shadow-5'>
			<img src = {'https://robohash.org/${prop.id}?200x200'} />
			<div>
				<h2> {prop.name} </h2>
				<p> {prop.email} </p>
			</div>	
		</div>
	);	
}

export default Card;
